import { Meteor } from 'meteor/meteor';
import React from 'react';
import ReactDOM from 'react-dom';

import App from './js/Main.jsx';
import './main.html';

Meteor.startup(function(){
  ReactDOM.render(<App/>, document.getElementById('shorts'));
});
